<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>场馆全景图</title>

    <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/@photo-sphere-viewer/core/index.min.css" />
    <style>
        /* 全景图容器 */
        #viewer {
            width: 100vw;
            height: 100vh;
            position: relative;
        }

        /* 按钮容器 */
        .buttons-container {
            position: absolute;
            top: 20px;
            left: 20px;
            display: flex;
            gap: 10px;
            z-index: 10;
        }

        /* 按钮样式 */
        .switch-button {
            padding: 10px 20px;
            background-color: rgba(0, 0, 0, 0.6);
            color: white;
            border: none;
            border-radius: 5px;
            cursor: pointer;
            font-size: 14px;
        }

        .switch-button:hover {
            background-color: rgba(255, 255, 255, 0.8);
            color: black;
        }
    </style>
</head>

<body>
    <!-- Viewer Container -->
    <div id="viewer">
        <!-- Buttons Overlay -->
        <div class="buttons-container">
            <button class="switch-button" onclick="switchPanorama(0)">一楼大厅</button>
            <button class="switch-button" onclick="switchPanorama(1)">1号厅</button>
            <button class="switch-button" onclick="switchPanorama(2)">2号厅</button>
        </div>
    </div>
